import React, { Component } from 'react';
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavbarItem, MDBNavbarLink, MDBIcon } from 'mdb-react-ui-kit';

export class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collapse: false,
        };
        this.onClick = this.onClick.bind(this);
    }
  
    onClick() {
      this.setState({
          collapse: !this.state.collapse,
        });
    }

    render() {
        return (
            <header>
            <MDBNavbar  dark expand="md" scrolling fixed="top">
              <MDBNavbarBrand href="/">
                  <strong>Navbar</strong>
              </MDBNavbarBrand>
              <MDBNavbarToggler onClick={ this.onClick } />
              <MDBCollapse isOpen = { this.state.collapse } navbar>
                <MDBNavbarNav left>
                  <MDBNavbarItem active>
                      <MDBNavbarLink to="#">Home</MDBNavbarLink>
                  </MDBNavbarItem>
                  <MDBNavbarItem>
                      <MDBNavbarLink to="#">Features</MDBNavbarLink>
                  </MDBNavbarItem>
                  <MDBNavbarItem>
                      <MDBNavbarLink to="#">Pricing</MDBNavbarLink>
                  </MDBNavbarItem>
                  <MDBNavbarItem>
                    <MDBNavbarLink to="#">Options</MDBNavbarLink>
                  </MDBNavbarItem>
                </MDBNavbarNav>
                <MDBNavbarNav right>
                  <MDBNavbarItem>
                    <MDBNavbarLink to="#"><MDBIcon fab icon="facebook-f" /></MDBNavbarLink>
                  </MDBNavbarItem>
                  <MDBNavbarItem>
                    <MDBNavbarLink to="#"><MDBIcon fab icon="twitter" /></MDBNavbarLink>
                  </MDBNavbarItem>
                  <MDBNavbarItem>
                    <MDBNavbarLink to="#"><MDBIcon fab icon="instagram" /></MDBNavbarLink>
                  </MDBNavbarItem>
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
          </header>
        )
    }
}

export default Header
